import React from "react";
import { Link } from "react-router-dom";
import { URLS } from "./../constants/route-links";
import Collections from "./collections";

const Navbar = () => {
  return (
    <nav className="w-full absolute top-0 p-5 border ">
      <div className="flex flex-row px-3 items-center justify-between">
        <div>
          <div className=" relative">
            <Link to={URLS.collections.url}>
              <p className=" font-sans text-Black font-bold text-3xl">
                Sneakers
              </p>
            </Link>
          </div>
          <div className="  flex space-x-6 text-GrayishBlue">
            <Link to = {URLS.collections.url}>
                Collections
            </Link>
          </div>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
